import React from 'react'
import { useParams } from 'react-router-dom'


function ProductDetails({ list }) {
    let id = useParams()
    console.log(id)
    return (
        <div className='productDetails'>
            {
                list.filter(item => item.id === id ).map
            }
        </div>
    )
}

export default ProductDetails
